pragma solidity ^0.5.0;

contract MedicalHistory {


    string public medicalHistory;

    event infoEvent (
       string medicalHistory
    );

    event hemoglobinEvent (
        string medicalHistory
    );

    event appointmentEvent (
        string medicalHistory
    );

    constructor(string memory mh) public{
        medicalHistory = mh;
    }

    function compareStrings (string memory a, string memory b) public view 
        returns (bool) {
            return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }

    function updateMedicalHistory (string memory mh, string memory tp) public{
        if(compareStrings(tp,"infoEvent")){
            emit infoEvent(mh);
        }
        if(compareStrings(tp,"hemoglobinEvent")){
            emit hemoglobinEvent(mh);
        }
        if(compareStrings(tp,"appointmentEvent")){
            emit appointmentEvent(mh);
        }
        medicalHistory = mh;
    }
}
